import React, {Component} from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
class Journal extends Component {
    constructor(props) {
        super(props);
        this.state = {
            date: "",
            highlights: "",
            mood: ""
        }
    }

    handleChange(e){
        console.log(e.target.value);
    }
    render() {
        return (
            <div>
                <form>
                    {/*today's date*/}
                    <TextField required id="standard-required" label="Date" placeholder="MM/DD/YYYY" value={this.state.date} onChange={this.handleChange}/>
                    {/*highlights*/}
                    <TextField required id="standard-required" label="Highlight" placeholder="How's your day?" value={this.state.highlights}/>
                    {/*mood*/}
                    <TextField required id="standard-required" label="Date" placeholder="How are you feeling?" value = {this.state.mood}/>
                    <Button variant="contained" color="primary">Submit</Button>
                </form>

            </div>
        )
    }
}
export default Journal;
